import * as React from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';

import "./Film.css";
import { Link } from 'react-router-dom';


function Film(props) {
    const {title,text,film_Pic,id}=props;
    if(film_Pic.length !== 0){
      this.setState({image: URL.createObjectURL(film_Pic[0])})
    }
    return(
        <div className="Cer">
         <Link className='link' to={'/films/' + id}><Card className="card">
      <CardActionArea>
  <Card>
  <div>
    <img
            component="source"
            height="140"
            src='data:image/png;base64,'
            alt="green iguana"
          
          />
          </div>
  </Card>
        <CardContent>
          <Typography gutterBottom variant="h5" component="div">
            {title}
          </Typography>
          <Typography variant="body2" color="text.secondary">
           {text}
           
          </Typography>
        </CardContent>
      </CardActionArea>
    </Card> </Link>
    {film_Pic}
        </div>
    )
    }
    export default Film;